import logo from './logo.svg';
import './App.css';
import Dashboard from './views/Dashboard';
import CreateEvent from './views/CreateEvent';
import DetailsEvent from './views/DetailsEvent';
import UpdateEvent from './views/UpdateEvent';
import { Route, Routes } from "react-router-dom"

function App() {
  return (
    <div className="App">



        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/event/new" element={<CreateEvent />} />
          <Route path="/event/:id" element={<DetailsEvent />} />
          <Route path="event/update/:id" element={<UpdateEvent />} />

        </Routes>


    </div>
  );
}

export default App;
